import React from 'react';
import NavTile from 'Views/Components/NavTile';
import getCategoryList from 'Data/Categories';

export default class CategoryList extends React.Component {

  render() {
    let categories = getCategoryList();

    return (
      <>
        <div className="text">
          <h1>Online services</h1>
        </div>

        <div className="groupPromo">
          <div className="listWebpart">
            <ul>
              {
                categories.categories.map((category) => {
                  let route = "Categories/" + category.name;
                  return (
                    <li key={category.name}>
                      <NavTile to={route} header={category.friendlyName} description={category.description} />
                    </li>
                  );
                })
              }

            </ul>
          </div>
        </div>
      </>
    );
  }
}
